    <style>
        body {
            margin: 0;
            height: 100vh;
            display: flex;
            justify-content: center;
            align-items: center;
            background-color: #050505;
            background-image: 
                linear-gradient(#1e1d1d 2px, transparent 2px),
                linear-gradient(90deg, #131212 2px, transparent 2px);
            background-size: 4px 4px; 
        }

        svg {
            width: 1100px; 
            height: auto;
        }

        
        svg {
            fill: none; 
            stroke: #00eaff; 
            stroke-width: 1;
            stroke-linecap: round;
            stroke-linejoin: round;
            
            filter: drop-shadow(0 0 2px #00eaff) 
                    drop-shadow(0 0 5px #00eaff) 
                    drop-shadow(0 0 15px #0077ff);
        
            animation: flicker 2s infinite alternate;
        }
		.container{
			position:absolute;
			justify-content: center;
			align-items: center;
			top:650px;
		}
		.button{
			height: 60px;
			width:250px;
			font-size: 40px;
			color:#00eaff;
			background: none;
			border-radius:30px;
			border:2px solid #00eaff ;
			font-family:'Gill Sans', 'Gill Sans MT', Calibri, 'Trebuchet MS', sans-serif;
			animation:glow-effect 2s infinite alternate;

		}
		.button:hover{
			font-size:0px;
		}
		.button:hover::after{
			content: "P.R.I.M.E";
			font-size:40px;
		}

		@keyframes glow-effect{
			from{
				text-shadow: 0 0 5px #0077ff;
				box-shadow: 0 0 5px #0077ff, 0 0 10px #0077ff ;
			}
			to{
				text-shadow: 0 0 10px #0077ff, 0 0 30px #0077ff;
				box-shadow: 0 0 10px #0077ff, 0 0 30px #0077ff ;
			}
		}
		

        @keyframes flicker {
            0%, 100% { opacity: 1; filter: drop-shadow(0 0 5px #00eaff) drop-shadow(0 0 10px #0077ff); }
            50% { opacity: 0.9; filter: drop-shadow(0 0 2px #00eaff) drop-shadow(0 0 5px #0077ff); }
        }
		


    </style>
